import React from "react";
import BasicItemsPage from "./BasicItemsPage";

import mealImage from "../images/burger_fries.png";
import sideItemImage from "../images/side_item.png";
import drinkImage from "../images/drink.png";
import dessertImage from "../images/dessert.png";

const OrderPage = () => {
  return(
    <div>
      <BasicItemsPage displayInfo={displayInfo} isButton="false"/>
    </div>
  );
}

const displayInfo = [
  {
    title: "Meals",
    image: mealImage,
    url: "/meals"
  },
  {
    title: "Sides",
    image: sideItemImage,
    url: "/sides"
  },
  {
    title: "Drinks",
    image: drinkImage,
    url: "/drinks"
  },
  {
    title: "Desserts",
    image: dessertImage,
    url: "/desserts"
  }
];

export default OrderPage;
